import React from "react";
import Logo from "../../assets/logo.svg";
import { Link, NavLink} from "react-router-dom";
import "./header.scss";

function Header() {
  const navLinks = [
    {
      display: "Home",
      path: "/",
    },
    {
      display: "Movies",
      path: "/movies",
    },
    {
      display: "TV Series",
      path: "/tv",
    },
  ];
  return (
    <header className="header">
      <Link to="/">
        <img className="logo" src={Logo} alt="logo" />
      </Link>
      <navbar className="navbar">
        <ul className="nav-list">
          {navLinks.map((link) => (
            <li className="list-item">
              <NavLink className="nav-link" to={link.path}>{link.display}</NavLink>
            </li>
          ))}
        </ul>
      </navbar>
      <Link to="" className="register-link"><i className="bi bi-box-arrow-in-right"></i> Sign In</Link>
    </header>
  );
}

export default Header;
